import React from 'react';
import { Link } from 'react-router-dom'; // Add this import
import './navbar8.css';

const Navbar8 = (props) => {
  return (
    <header className="navbar8-navbar">
      {/* Replace all <a> tags with <Link> components */}
      <div className="navbar8-links">
        <Link to="/" className="navbar8-link">
          {props.link1 || props.page1}
        </Link>
        <Link to="/email-input" className="navbar8-link">
          {props.link2 || props.page2}
        </Link>
        {/* Add other links similarly */}
      </div>

      <div className="navbar8-actions">
        <button className="thq-button-flat">
          {props.action1}
        </button>
        <button className="thq-button-filled">
          {props.action2}
        </button>
      </div>
    </header>
  );
};

export default Navbar8;
